import './Option.css'


function Option(props) {
  return (
    <div className="option">
        <FontAwesomeIcon icon="fa-solid fa-bed" style={{color: "#000000",}} />
        <button className='btn'>{props.title}</button>
    </div>
  )
}

export default Option
